July 07, 2011

Nick Lang is a paraplegic with a secret. The secret is, he isn't actually handicapped. He's just been pretending to be paralyzed so that he can reap the benefits that come with having a fuckilicious doctor like Aletta Ocean taking care of him day and night. During a physical exam, an erection gives Nick away and Aletta decides to have her way with him before tossing his ass on the street.
